import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import style from './Catalog.module.css';
import Assortment  from './Assortment/Assortment';


const Catalog = (props) => {
    let BrandsElements = props.state.brands.map(b => <div> {b} </div> );

    return(
        <div className={style.wrapper}>
                <div className={style.menu}>
                    <div className={style.title}>Бренды</div>
                    <div className={style.assortment}>
                        {BrandsElements}
                    </div>
                </div>
                <BrowserRouter>
                    <Route exact path='' render={ () => <Assortment state={props.state.products}/>} />
                </BrowserRouter>
                {/* <Route path='' render={ () => <Assortment state={props.state.products}/>} /> */}
        </div>
    )
};

export default Catalog;
